import Navbar from './Navbar';


function year(){
	if (process.browser){
		var theDate=new Date() ;
		var spit = theDate.getFullYear();
	}
	console.log(spit);
	return spit;
}

const Layout = (props) => (
	<div>
	<Head>
		<title>Audio-Boy</title>
	</Head>
		<div className='topBanner'>Subscribe <span className='bold'>NOW</span> for our updates & promotions! <span className='bold'>OVER HERE</span> 
		</div>
		<Navbar />
		<div className='container'>
			{props.children}
		</div>
		<div className='footerWrapper'>
			<div className='footer'>
				<div className='footerMenu'>
					<ul>
						<li className='footerLink'>
							<a href='#'>
								<p id="copyright">
									Â© {year()} Audio-Boy.
								</p>
							</a>
						</li>
				    	<li className='footerLink'><a href="#">Artists</a></li>
				        <li className='footerLink'><a href="#">News</a></li>
				        <li className='footerLink'><a href="#">Label Info</a></li>
				        <li className='footerLink'><a href="#">Store</a></li>
				        <li className='footerLink'><a href="#">Contact</a></li>
			      	</ul>
				</div>
			</div>
		</div>
	</div>
);


export default Layout;
